import React, { Component } from 'react';
import {getMovies} from '../service/moviesservice'
import {delmovie} from '../service/moviesservice'
class Movies extends Component {
    state = { 
        movies:getMovies(),
     } 
    render() { 
        return (
            <div>
                <table className="table">
                    <thead>
                    <tr>
                        <th>movie's name</th>
                        <th>id</th>
                        <th>ganre</th>
                        <th>length</th>
                        <th>delete</th>
                    </tr>
                    </thead>
                    <tbody>
                    {this.state.movies.map(movie=>(
                    <tr>
                        <td>{movie.name}</td>
                        <td>{movie.id}</td>
                        <td>{movie.genre}</td>
                        <td>{movie.length}</td>
                        <td><button onClick={delmovie()}>delete</button></td>
                    </tr>
                    ))}</tbody>
                </table>
            </div>
        );
    }
}

export default Movies;
